import Layout from '../components/Layout'
import ActionButton from '../components/Button'

const Index = () => {
    return (
        <div>
            <div className="image">
            </div>
            <p>Bei langeweile kannst du gerne die Webseite meiner wundervollen Frau besuchen: <a target="_blank" href="https://www.kwerbeed.de">www.kwerbeed.de</a></p>
            <ActionButton target='_blank' submitText="Weiter" link="#"  />
            <style jsx>{`
                div {
                    display: flex;
                    flex: 1 1 auto;
                    align-items: center;
                    flex-direction: column;
                    justify-content: center;
                }
                .image {
                    border-radius: 100%;
                    border: 1px solid;
                    height: 100px;
                    width: 100px;
                }
            `}</style>
        </div>
    )
}

export default Layout(Index)
